async function createUsers() {
    const users = await loadStaticData('users');
    await Promise.all(users.map(async ({ username, email, password, customDomain, key, role, deletedFlag, profileImage, securityQuestion, feedback, address, card, totpSecret = '' }) => {
        try {
            const completeEmail = customDomain ? email : `${email}@${config.get('application.domain')}`;
            const user = await models.User.create({
                username,
                email: completeEmail,
                password,
                role,
                deluxeToken: role === security.roles.deluxe ? security.deluxeToken(completeEmail) : '',
                profileImage: `assets/public/images/uploads/${profileImage || (role === security.roles.admin ? 'defaultAdmin.png' : 'default.svg')}`,
                totpSecret
            });
            datacache.users[key] = user;
            if (securityQuestion)
                await createSecurityAnswer(user.id, securityQuestion.id, securityQuestion.answer);
            if (feedback)
                await createFeedback(user.id, feedback.comment, feedback.rating, user.email);
            if (deletedFlag)
                await deleteUser(user.id);
            if (address)
                await createAddresses(user.id, address);
            if (card)
                await createCards(user.id, card);
        }
        catch (err) {
            logger.error(`Could not insert User ${key}: ${err.message}`);
        }
    }));
}

